import Vue from "vue";
import VueRouter from "vue-router";

Vue.use(VueRouter);

import Formulario from "./components/Formulario.vue";

export const router = new VueRouter({
    mode:"history",
    routes:[
        {path:"/"},
        {path:"/formulario", component: Formulario}],
});
